def fizz_buzz(n)
  result = []
  
  (1..n).each do |i|
    if i < 3
        result << i.to_s
    elsif i % 5 == 0 && i % 3 == 0
        result << "FizzBuzz"
    elsif i % 3 == 0
        result << "Fizz"
    elsif i % 5 == 0
        result << "Buzz"
    else
        result << i
    end
  end
  result
end

